import React from 'react';
import Slider from 'react-slick';
import { Link } from 'react-router-dom';
//import discountbanner from '../../../../../public/img/discount-banner.png';

import CardComponent from '../Card';
import './discount.scss';




const DiscountSlider = (props) => {
  const width = props.width ? { width: '33.33333333%' } : {};

  const discounts = props.allDiscount.map((item, index) => (
    <div style={index < 3 ? width : {}} key={item.id + index}>
      <CardComponent index={index} data={item} currency={props.currency} handlerClick={props.handlerClick} />
    </div>
  ));

  const settings = {
    dots: false,
    infinite: false,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 3,
    initialSlide: 0,
    lazyLoad: true,
    arrows: true,
    variableWidth: props.width,
    /*responsive: [
      {
        breakpoint: 991,
        settings: {
          slidesToShow: 2,
          slidesToScroll: 2,
          initialSlide: 2,
        },
      },
      {
        breakpoint: 768,
        settings: {
          slidesToShow: 1,
          slidesToScroll: 1,
        },
      },
    ],*/
  };
  return (
    <div className="discount">
			<div className="discount__desktop">
				<h2>Лучшие предложения</h2>
				<Slider {...settings} className="row">
				{discounts}
				</Slider>
				<div className="row">
				<div className="col-md-4 col-md-offset-8">
					<p className="text-center">
					<Link className="show-more" to="/discounts">
						Показать все предложения<i
						className="fa fa-arrow-right discount__arrow-right"
						aria-hidden="true"
						/>
					</Link>
					</p>
				</div>
				</div>
			</div>
			<div className="discount__mobile">
				<Link to="/discounts">
					<img className="img-responsive" src="data:image/png;base64," alt="Скидки" />
			 </Link>
			</div>
    </div>
  );
};

export default DiscountSlider;
